import React from 'react'
import {useDispatch, useSelector} from 'react-redux'
import Loading from '../Loading/Loading'

function Diets() {
    const dispatch = useDispatch()
    useEffect(() => {
        dispatch(getDiets())
    }, [dispatch])
    const diets = useSelector(state => state.diets)

    console.log(diets)
    diets ? 

        <div>
            <h1>HOLA</h1>
        </div>

    : 
    <Loading/>

}

export default Diets
